import React, { Component } from "react";
import { Row, Col, Container, Button } from "react-bootstrap";

class RobotState extends Component {
  state = {
    x: 0,
    y: 0,
    linear_velocity: 0,
    latitude: 0,
    longitude: 0,
    altitude: 0,
    battery: 0.11,
  };
  render() {
    return (
      <div>
        <Row>
          <Col>
            <h2>State</h2>
            <p className="mt-0">Latitude:{this.state.latitude}</p>
            <p className="mt-0">Longitude:{this.state.latitude}</p>
            <p className="mt-0">Altitude:{this.state.latitude}</p>
            <p className="mt-0">Velocity:{this.state.linear_velocity} m/s</p>
            <p className="mt-0">Battery:{this.state.battery}</p>
          </Col>
        </Row>
      </div>
    );
  }
}

export default RobotState;
